# 25-II-BDII-08-04

> *c* : aparentemente ele passou o exeplo 2 Stored Procedure para ser feito.

```sql
set @t2 = @t1 + 20;

select @t2 as var;
call sp_inout(@t2)
delimiter //
create procedure sp_inout (inout p int)
begin
	set @x = p\*2;
	set p = @x;
end
delimiter;
```

